import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import data from './etabs.json'
import storage from './'




export default function BasicTable() {
    const path = __dirname + "/localStorage/etabs.json" ;

    function createData(liste) {
        const ans = {} ;
        for (let i = 0 ; i < data.totalcount ; i++) {
            ans[(data.items[i]).nom] = liste[i] ; 
        }
        return ans;
    }
    const rows = [];
    return (
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }} aria-label="simple table">
                <TableHead>
                    <TableRow>
                        {(data.items).map((element) => (
                            <TableCell aligh="right">{element["libelle"]}</TableCell>
                        ))}
                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map((row) => (
                        <TableRow
                            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                        >
                            {(data.items).map((element) => 
                            <TableCell align="right">{row[element.nom]}</TableCell>)}
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
}
